import * as React from 'react';
import { Button, View } from 'react-native';
import { createDrawerNavigator, DrawerContentScrollView, DrawerItem } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';

import MainScreen from './src/screens/MainScreen';
import LoginScreen from './src/screens/LoginScreen';
import ExcerciseTypesScreen from './src/screens/ExcerciseTypesScreen';
import ExcerciseScreen from './src/screens/ExcerciseScreen';

const Drawer = createDrawerNavigator();

render = () => {
  <DrawerContentScrollView {...props}>
  <View style={styles.menuContainer}>
  <View style={[styles.menuItemsCard, { backgroundColor: "#fff2df" }]}>
  <View style={[styles.circleContainer, { backgroundColor: "#FFC56F" }]}>
  <Icon travel name="suitcase" type="font-awesome" color="#fbae41" />
  </View>
          <DrawerItem
           label="Screen1"
           labelStyle={{ color: "#fbae41", fontSize: 10 }}
                          onPress={() => {
                              props.navigation.navigate("PatientInfo");
                          }}
                      />
          </View>
          <View style={[styles.itemCard, { backgroundColor: "#EFFFD5" }]}>
          <View style={[styles.circleContainer, { backgroundColor: "#b5ff39" }]}>
          <Icon Medical name="briefcase" type="font-awesome" color="#609806"></Icon>
          </View>
                      <DrawerItem
                          label="Screen2"
                          labelStyle={{ color: "#609806" }}
                          onPress={() => {
                              props.navigation.navigate("Diagnose");
                          }}
                      />
                  </View>
              </View>
  </DrawerContentScrollView>
}

export default function DrawerNavigate() {
  return (
    <NavigationContainer>
      <Drawer.Navigator>
        <Drawer.Screen
          name="MainScreen"
          component={MainScreen}
          options={{title: 'Главная'}}
          />
        <Drawer.Screen
            name="ExcercisesScreen"
            component={ExcerciseTypesScreen}
            options={{title: 'Виды упражнений'}}
            />
        {/* <Drawer.Screen
            name="ExcerciseTypeScreen"
            component={ExcerciseScreen}
            options={{title: 'Упражнение'}}
            /> */}
        <Drawer.Screen
          name="LoginScreen"
          component={LoginScreen}
          options={{title: 'Авторизация'}}
          />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}
